import{_ as i,c as a,o as e,ae as t}from"./chunks/framework.Dh1jimFm.js";const c=JSON.parse('{"title":"前端面试官","description":"","frontmatter":{},"headers":[],"relativePath":"article/前端面试/外包面试/面试官-2022-11-02.md","filePath":"article/前端面试/外包面试/面试官-2022-11-02.md","lastUpdated":1743862747000}'),r={name:"article/前端面试/外包面试/面试官-2022-11-02.md"};function o(u,l,n,s,p,h){return e(),a("div",null,l[0]||(l[0]=[t('<h1 id="前端面试官" tabindex="-1">前端面试官 <a class="header-anchor" href="#前端面试官" aria-label="Permalink to &quot;前端面试官&quot;">​</a></h1><blockquote><p>面试时长：整体20-30min</p></blockquote><h2 id="一、面试流程" tabindex="-1">一、面试流程 <a class="header-anchor" href="#一、面试流程" aria-label="Permalink to &quot;一、面试流程&quot;">​</a></h2><h3 id="_1、开场-5min" tabindex="-1">1、开场（5min） <a class="header-anchor" href="#_1、开场-5min" aria-label="Permalink to &quot;1、开场（5min）&quot;">​</a></h3><ul><li><p>寒暄</p><ul><li><p>哈喽，请问是<strong>关子阳</strong>对吧？—— 是的</p></li><li><p>面试官自我介绍：你好，我是B站企业效率部的前端工程师<strong>九二</strong>，也是这次的面试官，欢迎参加今天的面试。</p></li><li><p>OK，时间差不多了要不我们开始吧~</p></li></ul></li><li><p>自我介绍</p><ul><li>先自我介绍一下吧？ <ul><li>17年毕业，18年开始前端</li><li>线上教育</li><li>众安保险 客服系统，react</li></ul></li><li>请问你目前在职吗？ <ul><li>若在职，为什么想换工作呢？</li><li>若离职，离职原因？对下一份工作的期望是怎样的？会比较看重哪些点？</li></ul></li></ul></li><li><p>熟悉一下（简历亮点或疑惑的点、自我介绍中的点）</p><ul><li>团队情况：业务、规模、团队中的角色（前端4个人，3个人客服系统、后台H5页面、半个月一迭代）</li><li>base在哪（外地的候选人）</li><li>一周内能到岗</li></ul></li></ul><h3 id="_2、项目考察-5min" tabindex="-1">2、项目考察（5min） <a class="header-anchor" href="#_2、项目考察-5min" aria-label="Permalink to &quot;2、项目考察（5min）&quot;">​</a></h3><ul><li>封装公共组件和utils（函数封装组件）</li></ul><h3 id="_3、技术点考察-10min" tabindex="-1">3、技术点考察（10min） <a class="header-anchor" href="#_3、技术点考察-10min" aria-label="Permalink to &quot;3、技术点考察（10min）&quot;">​</a></h3><p>外包同学能力维度</p><ul><li>实际项目经验（能干活） <ul><li>之前公司的研发流程、使用的项目管理工具？拿到需求会怎么开发？ <ul><li>双周迭代：【通过在线协同表格同步需求和进度】 <ul><li>周五下午需求评审，任务分配</li><li>7天开发</li><li>周四上午发布灰度</li><li>周四晚上上线（客服下班10点）</li></ul></li></ul></li><li>Git常用命令、Git分支规范、CI/CD是怎么做的？ <ul><li>Git工具：sourceTree</li><li>Git命令：add commit push（stash不太熟悉）</li><li>Git分支：release 生产 =&gt; feature</li><li>dev 测试</li></ul></li></ul></li><li>技术 <ul><li>基础：js、css <ul><li>深拷贝 vs 浅拷贝</li><li>js 变量提升</li><li>箭头函数</li><li>数组的方法</li><li>css定位</li></ul></li><li>应用： <ul><li>vue / react 的作用：封装dom操作</li><li>vue / react 的区别：写法上有区别</li><li>TS：有了解，使用中</li><li>重绘、重排</li></ul></li><li>深度：浏览器、EventLoop、vue原理 <ul><li>EventLoop：宏任务是浏览器api</li></ul></li><li>广度</li></ul></li><li>编码能力 <ul><li>递归算法(基本了解)</li></ul></li><li>软实力 <ul><li>英语能力</li><li>沟通能力：ok</li><li>对外包角色的看法：ok</li></ul></li></ul><h3 id="_4、编码考察-15min" tabindex="-1">4、编码考察（15min） <a class="header-anchor" href="#_4、编码考察-15min" aria-label="Permalink to &quot;4、编码考察（15min）&quot;">​</a></h3><h3 id="_5、q-a环节-5min" tabindex="-1">5、Q&amp;A环节（5min） <a class="header-anchor" href="#_5、q-a环节-5min" aria-label="Permalink to &quot;5、Q&amp;A环节（5min）&quot;">​</a></h3><p><strong>我这边暂时没有什么要问了，你有想要问我的吗？</strong></p><ul><li>部门业务情况：企业效率部门，主要有人事线（招聘、入转调离、绩效考勤）、业财法、中台支持系统（低代码平台、多语言平台），涉及的端：PC、H5、桌面端</li><li>技术栈：Vue3 + TS + 自研组件库和脚手架、低代码平台、Electron桌面端开发</li><li>团队规模：整个部门几百号人，研发大几十号人</li><li>加班情况：10:00 - 19:00 看项目情况加班，整体在互联网行业还是OK的</li></ul><p><strong>如果没有其他问题的话，我们今天的面试就先到这儿，如果有后续的面试安排HR会联系你</strong></p><h2 id="二、考察重点" tabindex="-1">二、考察重点 <a class="header-anchor" href="#二、考察重点" aria-label="Permalink to &quot;二、考察重点&quot;">​</a></h2><p>能力维度</p><ul><li>技术能力：基础技术点、<strong>技术深度</strong>、<strong>技术广度</strong>、<strong>架构能力</strong></li><li>项目能力：对项目的思考</li><li>沟通能力：思路逻辑清晰</li></ul><h2 id="三、面试评价" tabindex="-1">三、面试评价 <a class="header-anchor" href="#三、面试评价" aria-label="Permalink to &quot;三、面试评价&quot;">​</a></h2><h3 id="面评框架" tabindex="-1">面评框架 <a class="header-anchor" href="#面评框架" aria-label="Permalink to &quot;面评框架&quot;">​</a></h3><ul><li>面试总评：整体面试不错/一般/不太好，建议定级（如果有<code>+</code> <code>-</code> 的情况，需标明原因）</li><li>亮点：(备注：项目、技术、业务、软技能)</li><li>不足：（备注：项目、技术基础/深度）</li><li>其他考虑点：（备注：选填，如base其他城市/意向不强等）</li></ul><h3 id="面评格式" tabindex="-1">面评格式 <a class="header-anchor" href="#面评格式" aria-label="Permalink to &quot;面评格式&quot;">​</a></h3><p>面试总评：17年毕业，18年开始前端，先在线上教育行业（技术栈vue），上家在众安做外包，主要是客服系统（技术栈react）</p><p>亮点： 1、项目经验答的不错，能完整描述整个项目开发过程，确实有实际的开发经验 2、基础这块还可以，答的过程中有加入一些自己的思考 3、沟通理解能力不错，聊的比较顺畅</p><p>不足： 1、react的模块复用这块表达的不是很清楚 2、递归算法思路描述的不是太好</p><p>其他： 1、能接受外包身份</p><h2 id="四、回顾小结" tabindex="-1">四、回顾小结 <a class="header-anchor" href="#四、回顾小结" aria-label="Permalink to &quot;四、回顾小结&quot;">​</a></h2><p>面试前：</p><ul><li>提前定会议室，或提前半小时找电话亭</li></ul><p>面试中：</p><ul><li>因为原本的面试官抽不开身，我这边是临时接到的面试任务，作为这次的面试官，让你久等了真是抱歉。</li></ul><p>面试后：</p><ul><li>面评10分钟内写完，不纠结</li></ul><p>总体标准</p><ul><li>5分以下淘汰</li><li>6分待定</li><li>7/8分以上通过</li></ul><p>具体打分</p><ul><li><p>项目（30%）</p></li><li><p>基础 （40%）</p></li><li><p>软实力 （30%）</p></li><li><p>总分（10分）</p></li></ul>',37)]))}const m=i(r,[["render",o]]);export{c as __pageData,m as default};
